import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { emphasize, fade, darken, lighten } from '@material-ui/core/styles/colorManipulator';

import clsx from 'clsx';
import service from './../service/UserService';
import { useHistory } from "react-router-dom";

import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import { Link } from 'react-router-dom';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';


const useStyles = makeStyles((theme) => ({
  section: {
    position: "absolute",
    top: "45%",
    left: "50%",
    transform: "translate(-50%, -50%)",
  },
  actions: {
    alignText: "center",
    [theme.breakpoints.down('sm')]: {
      marginTop: theme.spacing(4)
    },
  }
}
));

export default function Component(props) {

  const [username, setUsermame] = useState();
  const [password, setPassword] = useState();

  let history = useHistory();

  const handleSubmit = async () => {

    const json = JSON.stringify({
      "firstName": "",
      "lastName": "",
      "userCredentials": {
        "username": username,
        "password": password,
      },
      "email": "",
      "company": ""
    });

    let success = await service.loginUser(json);

    console.log("SUCCEESS:", success);

    if(success == null || success == "") {
      //history.push("/input");
      alert("An account with that username and password could not be found.");
    }
    else {
      alert("Success");
      event.preventDefault();
    }

  }

  const onChangeUsername = (event) => {
    setUsermame(event.target.value);
  }
  const onChangePassword = (event) => {
    setPassword(event.target.value);
  }

  const classes = useStyles();

  return (
    <section className={classes.section}>
      <Container maxWidth="xs">
        <Box pt={8} pb={10}>
          <Box mb={3} textAlign="center">
            <Typography variant="h5" component="h2">Sign in</Typography>
          </Box>
          <Box>
            <form validate="true" onSubmit={handleSubmit}>
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <TextField variant="outlined" required fullWidth value={username} onChange={onChangeUsername} name="username" id="username" label="Username" autoComplete="current-username" />
                </Grid>
                <Grid item xs={12}>
                  <TextField variant="outlined" required fullWidth value={password} onChange={onChangePassword} name="password" id="password" label="Password" type="password" autoComplete="current-password" />
                </Grid>
              </Grid>
              <Box my={2}>
                <Button type="button" onClick={handleSubmit} fullWidth variant="contained" color="primary">Sign in</Button>
              </Box>
              <Grid container className={classes.actions}>
                <Link to="/register" variant="body2" style={{ textDecoration: 'none' }}>Don't have an account? Register.</Link>
              </Grid>
            </form>
          </Box>
        </Box>
      </Container>
    </section>
  );
}
